import React, { useState } from 'react';
import 'bootstrap-icons/font/bootstrap-icons.css';
import './NavBar.css'; // Archivo CSS
import Logo from '../../Assets/Img_Home/Logo.png';

const NavBarPrueba = () => {
  const [menuVisible, setMenuVisible] = useState(false);

  const toggleMenu = () => {
    setMenuVisible(!menuVisible);
  };

  return (
    <header className="header">
      <img className="logo" src={Logo} alt="InnoVenta Logo" />
      {/* Botón hamburguesa */}
      <button
        className="abrir-menu"
        aria-expanded={menuVisible}
        onClick={toggleMenu}
      >
        <i className="bi bi-list"></i>
      </button>
      {/* Menú de navegación */}
      <nav className={`nav-1 ${menuVisible ? 'visible' : ''}`}>
        <button className="cerrar-menu" onClick={toggleMenu}>
          <i className="bi bi-x-circle"></i>
        </button>
        <ul className="nav-list">
          <li>
            <a href="#">Inicio</a>
          </li>
          <li>
            <a href="#">Membresía</a>
          </li>
          <li>
            <a href="#">Productos</a>
          </li>
          <li>
            <a href="#">Contacto</a>
          </li>
        </ul>
      </nav>
      <button className="fondo-boton">Comenzar</button>
    </header>
  );
};

export default NavBarPrueba;
